import React from "react";
import Navbar from "../../components/LandingPageComponents/Navbar";
import img1 from "../../assets/img1.png";
import ImageText from "../../components/LandingPageComponents/ImageText";

const HomePage = () => {
    return (
      <div>
        <div>
            <Navbar />
        </div>
        <div>
            <img src={img1} alt="" />
            <ImageText text={
                "You can learn"
            } text={""}/>
        </div>
      </div>
    )
}

export default HomePage;
